tables.table_schema:
CREATE TABLE protein_interactions (
    protein_id UUID PRIMARY KEY,
    interaction_partner_id UUID,
    interaction_type VARCHAR,
    interaction_score FLOAT
);

CREATE TABLE protein_details (
    protein_id UUID PRIMARY KEY,
    protein_name VARCHAR,
    gene_name VARCHAR,
    protein_function TEXT
);

CREATE TABLE ProteinInteraction (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255),
    interaction_partner_id INT,
    interaction_type VARCHAR(50)
);

CREATE TABLE Protein (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255),
    gene_name VARCHAR(255),
    organism VARCHAR(100)
);

CREATE TABLE InteractionType (
    interaction_id INT PRIMARY KEY,
    interaction_name VARCHAR(255)
);

CREATE TABLE InteractionEvidence (
    evidence_id INT PRIMARY KEY,
    interaction_id INT,
    publication_id INT,
    experimental_method VARCHAR(100)
);

CREATE TABLE Publication (
    publication_id INT PRIMARY KEY,
    publication_title VARCHAR(255),
    publication_date DATE
);
